import React from 'react'
import { Link } from "react-router-dom";

function Reactions({value, likes, comment, post}) {
    return (
        <div className="reactions">
             <span>
                <i
                style={{ color:"#e60000" }}
                className={
                    value >= 1
                    ? "fa fa-heart"
                    : value == 0
                    ? "fa-regular fa-heart"                   
                    : "far fa-heart-o"
                }
                ></i>
                {likes}
            </span>
           
            
             <span className="reaction">
                 <Link to={`/post/${post}`}>
                    <i
                    style={{ color:"" }}
                    className={"fa fa-comment"}
                    ></i>
                    {comment}
                 </Link>
               
            </span>

            <span>
                <i
                style={{ color:"" }}
                className={"fa fa-share"}
                ></i>
            </span>
        </div>
    )
}

export default Reactions
